/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-cp-root" @click=${context._onclick} @keyup=${context._onkeyup} @keydown=${context._onkeydown}><div class="ui5-cp-item-container" role="region" aria-label="${ifDefined(context.colorContainerLabel)}">${ repeat(context.displayedColors, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div>${ context._showMoreColors ? block2(context) : undefined }${ context.showRecentColors ? block3(context) : undefined }</div>`; };
const block1 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>`; };
const block2 = (context) => { return html`<div class="ui5-cp-more-colors-wrapper"><div class="ui5-cp-separator"></div><${scopeTag("ui5-button", tags, suffix)} design="Transparent" class="ui5-cp-more-colors" @click="${context._openMoreColorsDialog}">${ifDefined(context.colorPaleteMoreColorsText)}</${scopeTag("ui5-button", tags, suffix)}></div>`; };
const block3 = (context) => { return html`<div class="ui5-cp-separator"></div><div class="ui5-cp-recent-colors-wrapper">${ repeat(context.recentColors, (item, index) => item._id || index, (item, index) => block4(item, index, context)) }</div>`; };
const block4 = (item, index, context) => { return html`<${scopeTag("ui5-color-palette-item", tags, suffix)} value="${ifDefined(item)}"></${scopeTag("ui5-color-palette-item", tags, suffix)}>`; };


	return block0(context);
};

export default main;
